    constructor(userService, movieService) {
        this.userService = userService;
        this.movieService = movieService;
        this.moviesArray = [];
    }
    ngOnInit() {
        this.movieService.getAllMovies().subscribe({
            next: data => {
                this.moviesArray = data;
            },
            error: err => {
                console.log(err);
            }
        });
